import React, { useEffect} from 'react';
import AuthUser from './AuthUser';
import { Link,useNavigate } from 'react-router-dom';

export default function Home() {
  const { wpisy, fetchPosts } = AuthUser();

  useEffect(() => {
    fetchPosts();
  }, []);
  const navigate = useNavigate();
  const handleEdit = (id) => {
    navigate(`/edit/${id}`);
  };

  return (

    <div>
      <div class="container">
    <h1 class="mt-4 mb-4">Posty</h1>

    <div class="row">
      <div class="col-md-8 offset-md-2">
        {wpisy.map((wpis) => (
        <div class="card mb-4" key={wpis.id}>
          <div class="card-body">
            <h5 class="card-title">{wpis.id}</h5>
            <h6 class="card-subtitle mb-2 text-muted">{wpis.user_id}</h6>
            <p class="card-text">{wpis.tresc}</p>
            <a href="#" class="btn btn-primary">Edytuj</a>
            <a href="#" class="btn btn-danger">Usuń</a>
            <a href="#" class="btn btn-info">Komentarze</a>
          </div>
        </div>))}

        <div class="card mb-4">
          <div class="card-body">
            <h5 class="card-title">Tytuł postu</h5>
            <h6 class="card-subtitle mb-2 text-muted">Autor</h6>
            <p class="card-text">Treść postu Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed hendrerit
              mollis eros id luctus. Fusce tristique dapibus orci non dictum. Phasellus ut lacus felis. Curabitur
              iaculis consequat ex, non fermentum est ultricies vel. Nam sagittis ligula quis lectus iaculis, nec
              volutpat nisi tincidunt. Donec elementum ligula dolor, vitae pellentesque eros congue in. Morbi
              tincidunt tellus a nunc malesuada, vitae rhoncus quam blandit.</p>
              <button className="btn btn-primary" nonClick={() => handleEdit(wpis.id)}>Edytuj</button>
            <a href="#" class="btn btn-danger">Usuń</a>
            <a href="#" class="btn btn-info">Komentarze</a>
          </div>
        </div>
      </div>
    </div>

    <div class="row">
      <div class="col-md-8 offset-md-2">
      <Link to="/create" className="btn btn-success">Dodaj post</Link>
      </div>
    </div>
  </div>
    </div>
  );
}
